	public String getGenderList(){
		GeneralDao objDao = new GeneralDao();		
		List<Gender> lst = objDao.getGenderList();
		JSONArray jArray = new JSONArray();
		try {
			for (int i=0;i<lst.size();++i){
				JSONObject jobj = new JSONObject();
				jobj.put("ID", lst.get(i).getGenderId());
				jobj.put("NAME", lst.get(i).getGenderName());
				jArray.put(i, jobj);
			}			
		} catch (JSONException e) {
			e.printStackTrace();
		}
		return jArray.toString();
	}
	
	public String getReportList(String crNo,String hosCode){
		GeneralDao objDao = new GeneralDao();		
		List<Report> lst = objDao.getReportList(crNo,hosCode);
		JSONArray jArray = new JSONArray();
		try {
			for (int i=0;i<lst.size();++i){
				JSONObject jobj = new JSONObject();
				jobj.put("TESTNAME", lst.get(i).getTestName());
				jobj.put("REQDNO", lst.get(i).getReqDNo());
				jobj.put("REPORTDATE", lst.get(i).getReportDate());
				jArray.put(i, jobj);
			}			
		} catch (JSONException e) {
			e.printStackTrace();
		}
		return jArray.toString();
	}
	
	
	public String getInvestigationDataList(String crNo,String hosCode){
		GeneralDao objDao = new GeneralDao();		
		List<InvestigationData> lst = objDao.getInvestigationList(crNo,hosCode);
		String testname = null;
		String entryDate = null;
		JSONArray jArray = new JSONArray();
		JSONArray jArray1 = null;
		JSONArray jArray2 = new JSONArray();
		//JSONArray jArray2 = null;
		
		try {
			for (int i=0;i<lst.size();++i){
				int t= 0;
				JSONObject jobj = new JSONObject();
				
				JSONObject jobj2 = new JSONObject();
				
				
				if(i != 0)
					testname = lst.get(i-1).getTestName();
					
				
				if(testname != null && testname.equals(lst.get(i).getTestName())){
					t++;
					jobj2.put("ENTRYDATE", lst.get(i).getEntryDate());
					jArray2.put(jobj2);
				}else{
					jArray2 = new JSONArray();
					jobj.put("TESTNAME", lst.get(i).getTestName());
					jobj2.put("ENTRYDATE", lst.get(i).getEntryDate());
					jArray2.put(jobj2);
				}
					
					
				
				jArray1 = new JSONArray();
				
				for (int j=0;j<lst.get(i).getParam().size();++j){
					
					
					JSONObject jobj1 = new JSONObject();
					
					 jobj1.put("PARAMETERCODE", lst.get(i).getParam().get(j).getParameterCode());
					 jobj1.put("PARAMETERNAME", lst.get(i).getParam().get(j).getParameterName());
					 jobj1.put("VALUE", lst.get(i).getParam().get(j).getValue());
					 if(lst.get(i).getParam().get(j).getStandardRange() != null)
						 jobj1.put("RANGE", Utility.getStandardRange(lst.get(i).getParam().get(j).getStandardRange()));
					 else
						 jobj1.put("RANGE", "--");
					 
					 
					 
					 jArray1.put(j, jobj1);
				}
				
				
				jobj2.put("DETAILS", jArray1);
				
				if(t != 0){
					if(jobj!=null && !jobj.toString().equals("{}"))
						jArray2.put(jobj);
				}
				else{
					jobj.put("DATA", jArray2);
					jArray.put(jobj);
				}
				
			}			
		} catch (JSONException e) {
			e.printStackTrace();
		}
		return jArray.toString();
	}
	
	
