	public String getDistrictNames(String stateId){
		int stId = Integer.valueOf(stateId);
		GeneralDao objDao = new GeneralDao();
		List<District> districtList = objDao.getDistrictNames(stId);
		JSONArray jArray = new JSONArray();
		try {
			for (int i=0;i<districtList.size();++i){
				JSONObject jobj = new JSONObject();
				jobj.put("ID", districtList.get(i).getDistrictId());
				jobj.put("NAME", districtList.get(i).getDistrictName());
				jArray.put(i, jobj);
			}			
		} catch (JSONException e) {
			e.printStackTrace();
		}
		return jArray.toString();
	}
	
	public String getHospitalList(String hash) {
		GeneralDao objDao = new GeneralDao();
		List<Hospital> lst = objDao.getHospitalList();
		JSONArray jArray = new JSONArray();
		String result = "";
		try {
			for (int i=0;i<lst.size();++i){
				JSONObject jobj = new JSONObject();
				jobj.put("ID", lst.get(i).getHospitalCode());
				jobj.put("NAME", lst.get(i).getHospitalName());
				jArray.put(i, jobj);
			}		
			result = Utility.checkForHash(jArray, hash);
		} catch (JSONException e) {
			e.printStackTrace();
		}
		return result;
	}
	
	
