	public String getParaRawData(String crNo,String hosCode,String paraCode){
        GeneralDao objDao = new GeneralDao();                
        List<RawData> lst = objDao.getParaRawData(crNo,hosCode,paraCode);
        String parameterName = null;
       
        JSONArray jArray = new JSONArray();
        JSONArray jArray1 = null;
        
        try {
                for (int i=0;i<lst.size();++i){
                        JSONObject jobj = new JSONObject();
                        
                        jobj.put("PARAMETERNAME", lst.get(i).getParameterName());
                        
                        jArray1 = new JSONArray();
                        
                        for (int j=0;j<lst.get(i).getRaw().size();++j){
                                
                                
                                JSONObject jobj1 = new JSONObject();
                                
                                jobj1.put("ENTRYDATE", lst.get(i).getRaw().get(j).getEntryDate());
                                 jobj1.put("TESTNAME", lst.get(i).getRaw().get(j).getTestName());
                                 jobj1.put("VALUE", lst.get(i).getRaw().get(j).getValue());
                                 if(lst.get(i).getRaw().get(j).getStandardRange() != null)
                                	 jobj1.put("RANGE", Utility.getStandardRange(lst.get(i).getRaw().get(j).getStandardRange()));
                                 else
                                	 jobj1.put("RANGE", "--");
                                 
                                 
                                 
                                 
                                 jArray1.put(j, jobj1);
                        }
                        
                        jobj.put("DETAILS", jArray1);
                        
                        jArray.put(i, jobj);
                }                        
        } catch (JSONException e) {
                e.printStackTrace();
        }
        return jArray.toString();
	}	
	
	
